import React from 'react';

// Event Data Interface
interface Event {
  id: number;
  name: string;
  date: string; 
  location: string;
  society: string;
  image: string; 
}

//sample event 
const events: Event[] = [
  {
    id: 1,
    name: 'Innovance 3.0',
    date: '2025-01-15',
    location: 'Campus 6 Auditorium',
    society: 'IoT Lab',
    image: 'data:image/jpeg;base64,'  },
  {
    id: 2,
    name: 'Hackathon',
    date: '2025-01-16',
    location: 'Campus 5 Auditorium',
    society: 'KIIT Coding Club',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    name: 'KiiT Fest',
    date: '2025-01-10',
    location: 'Campus 7',
    society: 'KSAC',
    image: 'data:image/jpeg;base64,',
  },
];


const sortByLatest = (events: Event[]) => {
  return events.sort((a, b) => new Date(b.date).getTime() - new Date(a.date).getTime());
};

const list: React.FC = () => {
  const sortedEvents = sortByLatest(events);

  return (
    <div className="min-h-screen p-6">
      <h1 className="text-3xl font-bold text-center mb-6">Upcoming Events</h1>
      <div className="space-y-6">
        {sortedEvents.map((event) => (
          <div
            key={event.id}
            className="flex flex-col md:flex-row bg-[#111827] shadow-md rounded-lg overflow-hidden hover:shadow-lg transition-shadow"
          >
            <img
              src={event.image}
              alt={event.name}
              className="md:w-1/3 w-full object-cover"
            />
            <div className="p-4 md:w-2/3">
              <h2 className="text-2xl font-bold mb-2">{event.name}</h2>
              <p className="text-gray-700 mb-1">
                <span className="font-semibold">Location:</span> {event.location}
              </p>
              <p className="text-gray-700 mb-1">
                <span className="font-semibold">Society:</span> {event.society}
              </p>
              <p className="text-gray-700">
                <span className="font-semibold">Date:</span>{' '}
                {new Date(event.date).toLocaleDateString()}
              </p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default list;
